import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { 
  LayoutDashboard, 
  Map, 
  AlertTriangle, 
  ListOrdered,
  MoreVertical,
  Droplets,
  Zap,
  Brain,
  BarChart3,
  Bell,
  FileText,
  User,
  X
} from 'lucide-react';

const EmergencyBottomNav = () => {
  const location = useLocation();
  const [showMenu, setShowMenu] = useState(false);

  const mainItems = [
    { icon: LayoutDashboard, label: 'Центр', path: '/emergency/control-center' },
    { icon: Map, label: 'Карта', path: '/emergency/map' },
    { icon: AlertTriangle, label: 'Критич.', path: '/emergency/critical-zones' },
    { icon: ListOrdered, label: 'Приорит.', path: '/emergency/prioritization' },
  ];

  const moreItems = [
    { icon: Droplets, label: 'Водоёмы', path: '/emergency/waterbodies' },
    { icon: Zap, label: 'ГТС', path: '/emergency/facilities' },
    { icon: Brain, label: 'Прогнозирование', path: '/emergency/predictions' },
    { icon: BarChart3, label: 'Аналитика', path: '/emergency/analytics' },
    { icon: Bell, label: 'Уведомления', path: '/emergency/notifications' },
    { icon: FileText, label: 'Отчёты', path: '/emergency/reports' },
    { icon: User, label: 'Профиль', path: '/emergency/profile' },
  ];

  const isActive = (path) => location.pathname === path;

  return (
    <>
      {/* More Menu Overlay */}
      {showMenu && (
        <div className="lg:hidden fixed inset-0 bg-black/50 backdrop-blur-sm z-40" onClick={() => setShowMenu(false)}>
          <div 
            className="absolute bottom-20 left-0 right-0 bg-gradient-to-b from-white-600 to-white-700 rounded-t-3xl shadow-2xl p-6 animate-slide-up"
            onClick={(e) => e.stopPropagation()}
          >
            <div className="flex items-center justify-between mb-6">
              <h3 className="text-xl font-bold text-white">Дополнительно</h3>
              <button
                onClick={() => setShowMenu(false)}
                className="w-10 h-10 flex items-center justify-center rounded-xl bg-white/10 hover:bg-white/20 transition-colors"
              >
                <X className="w-6 h-6 text-white" />
              </button>
            </div>

            <div className="grid grid-cols-3 gap-3">
              {moreItems.map((item) => {
                const Icon = item.icon;
                const active = isActive(item.path);
                
                return (
                  <Link
                    key={item.path}
                    to={item.path}
                    onClick={() => setShowMenu(false)}
                    className={`flex flex-col items-center space-y-2 p-4 rounded-2xl transition-all ${
                      active
                        ? 'bg-white/20 text-white shadow-lg'
                        : 'bg-white/5 text-red-100 hover:bg-white/10'
                    }`}
                  >
                    <Icon className="w-6 h-6" />
                    <span className="text-xs font-medium text-center">{item.label}</span>
                  </Link>
                );
              })}
            </div>
          </div>
        </div>
      )}

      {/* Bottom Navigation Bar */}
      <div className="lg:hidden fixed bottom-0 left-0 right-0 z-50 bg-gradient-to-r from-red-600 to-red-700 border-t border-red-500/30 shadow-2xl">
        <div className="grid grid-cols-5 h-20">
          {mainItems.map((item) => {
            const Icon = item.icon;
            const active = isActive(item.path);
            
            return (
              <Link
                key={item.path}
                to={item.path}
                className={`flex flex-col items-center justify-center space-y-1 transition-all ${
                  active ? 'text-white' : 'text-red-200'
                }`}
              >
                <div className={`relative ${active ? 'scale-110' : ''}`}>
                  <Icon className="w-6 h-6" />
                  {active && (
                    <div className="absolute -top-1 -right-1 w-2 h-2 bg-white rounded-full animate-pulse" />
                  )}
                </div>
                <span className="text-xs font-medium">{item.label}</span>
              </Link>
            );
          })}

          {/* More Button */}
          <button
            onClick={() => setShowMenu(!showMenu)}
            className={`flex flex-col items-center justify-center space-y-1 transition-all ${
              showMenu ? 'text-white' : 'text-red-200'
            }`}
          >
            <MoreVertical className={`w-6 h-6 ${showMenu ? 'scale-110' : ''}`} />
            <span className="text-xs font-medium">Ещё</span>
          </button>
        </div>
      </div>
    </>
  );
};

export default EmergencyBottomNav;
